INSERT INTO `bit_news` (`id`,`title`,`author`,`date`,`type`,`content`,`views`,`locked`) VALUES 
 (1,'Revision 1: week of 2/12/17','Rhodonite','03.15','ct_news_gameup','<ul>\r\n	<li>XiuzSource import</li>\r\n	<li>Fixed a bunch of dupes</li>\r\n	<li>Added gender for cash shop items</li>\r\n	<li>Fixed exp gachapon item</li>\r\n	<li>Added CPQ</li>\r\n	<li>Fixed a bunch of NPCs</li>\r\n</ul>\r\n',0,0),
 (2,'Revision 2: week of 2/19/17','Rhodonite','03.15','ct_news_gameup','<ul>\r\n	<li>Added expiration on cash items</li>\r\n</ul>\r\n\r\n<p>â€‹ <img alt=\"\" src=\"http://i.imgur.com/9gxwkEE.png?1\" style=\"height:302px; width:348px\" /></p>\r\n\r\n<ul>\r\n	<li>Fixed some bugs in cash shop that let you buy items not on sale</li>\r\n	<li>Disabled MTS</li>\r\n	<li>Made MTS button warp to FM</li>\r\n	<li>Fixed rollback bug with FM warp</li>\r\n	<li>Redid sendops completely</li>\r\n	<li>Fixed portal scripts: Populatus00, q2073, enter_earth01, enter_earth00, minar_elli, Pianus</li>\r\n</ul>\r\n',2,0),
 (4,'Revision 4: week of 3/5/17','Rhodonite','03.15','ct_news_gameup','<ul>\r\n	<li>Fixed KPQ Changed monster respawns</li>\r\n	<li>Fixed KPQ mobs not respawning</li>\r\n	<li>Fixed 85% of LPQ</li>\r\n	<li>Fixed LMPQ</li>\r\n	<li>Added drops to LMPQ monsters</li>\r\n	<li>Added drops to Singapore monsters</li>\r\n	<li>Changed boss drops so they drop more</li>\r\n	<li>Started on custom item forging for ITCG</li>\r\n	<li>Fixed MP Recovery</li>\r\n	<li>Fixed Recovery</li>\r\n	<li>Fixed Armor Crash</li>\r\n	<li>Fixed Power Crash</li>\r\n	<li>Fixed Magic Crash</li>\r\n	<li>Fixed change leader for parties</li>\r\n	<li>Fixed bug where parties don&#39;t show up for some people</li>\r\n	<li>Fixed bug where pets could dc maps</li>\r\n	<li>Added area bosses and made them respawn properly</li>\r\n</ul>\r\n\r\n<p>â€‹ <img alt=\"\" src=\"http://i.imgur.com/vGzMJ7e.png?1\" style=\"height:351px; width:264px\" /></p>\r\n\r\n<ul>\r\n	<li>Gave safety charms a weeklong period instead of 90 days</li>\r\n</ul>\r\n',4,0),
 (3,'Revision 3: week of 2/26/17','Rhodonite','03.15','ct_news_gameup','<ul>\r\n	<li>Added quest drops from mobs so they only drop when quest is active</li>\r\n	<li>Fixed reactors causing error 38</li>\r\n	<li>Fixed sell price of stars in shops</li>\r\n	<li>Fixed item expiration resetting in storage</li>\r\n	<li>Fixed jumping down making monsters go weird</li>\r\n	<li>Fixed speed infusion</li>\r\n	<li>Fixed 3rd person critical hits</li>\r\n</ul>\r\n',1,0),
 (5,'Revision 5: week of 3/12/17','Rhodonite','03.15','ct_news_gameup','<ul>\r\n	<li>Fixed certain types of scrolls using white scrolls when they&#39;re not supposed to</li>\r\n	<li>Fixed slot 1 in merchants disconnecting players</li>\r\n	<li>Fixed cash shop packet so its different from generic v62s</li>\r\n</ul>\r\n\r\n<p>â€‹<img alt=\"\" src=\"http://i.imgur.com/ZyeLWh1.png\" style=\"height:599px; width:542px\" /></p>\r\n\r\n<ul>\r\n	<li>Timer changes</li>\r\n	<li>Fixed crashing on char creation due to item expiration on certain items</li>\r\n	<li>Fixed certain skills not displaying proper animations at lower levels</li>\r\n	<li>Fixed taunt not giving bonus EXP</li>\r\n	<li>Added bonus EXP maps</li>\r\n	<li>Fixed a bunch of stuff in related to party visuals</li>\r\n	<li>Fixed steal</li>\r\n	<li>Added bonus boss EXP/drops</li>\r\n	<li>Made buffs cancel upon entering into CS so you don&#39;t get dced</li>\r\n	<li>Fixed CS dcing you back to login everytime you left</li>\r\n	<li>Started on Fredrick storage</li>\r\n	<li>Fredrick is now GMS-like and works</li>\r\n</ul>\r\n\r\n<p>â€‹<img alt=\"\" src=\"http://i.imgur.com/UYY0ieP.png?1\" style=\"height:403px; width:296px\" /></p>\r\n\r\n<ul>\r\n	<li>Fixed summon damage not appearing 3rd person</li>\r\n	<li>Started on custom questline</li>\r\n	<li>Started on merchant chats</li>\r\n</ul>\r\n',8,0);
